// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./WorldTreasury.sol";

/**
 * @title AgentMarketplace
 * @dev P2P marketplace for agents to trade items, hire each other, and invest
 */
contract AgentMarketplace {
    WorldTreasury public treasury;
    MONToken public monToken;
    
    struct Listing {
        address seller;
        string itemType;
        uint256 quantity;
        uint256 pricePerUnit;
        bool active;
        uint256 createdAt;
    }
    
    struct ServiceOffer {
        address provider;
        string serviceType;
        uint256 pricePerAction;
        bool active;
        uint256 completedJobs;
    }
    
    struct Investment {
        address investor;
        address agent;
        uint256 amount;
        uint256 timestamp;
        uint256 profitShare; // Percentage (0-100)
    }
    
    uint256 public listingCounter;
    uint256 public serviceCounter;
    uint256 public investmentCounter;
    
    mapping(uint256 => Listing) public listings;
    mapping(uint256 => ServiceOffer) public services;
    mapping(uint256 => Investment) public investments;
    mapping(address => uint256[]) public agentListings;
    mapping(address => uint256[]) public agentServices;
    mapping(address => uint256) public totalInvested;
    
    event ItemListed(uint256 indexed listingId, address indexed seller, string itemType, uint256 quantity, uint256 price);
    event ItemPurchased(uint256 indexed listingId, address indexed buyer, address indexed seller, uint256 quantity, uint256 totalPrice);
    event ServiceOffered(uint256 indexed serviceId, address indexed provider, string serviceType, uint256 price);
    event ServicePurchased(uint256 indexed serviceId, address indexed buyer, address indexed provider, uint256 price);
    event InvestmentMade(uint256 indexed investmentId, address indexed investor, address indexed agent, uint256 amount, uint256 profitShare);
    event ProfitDistributed(uint256 indexed investmentId, address indexed investor, uint256 profit);
    
    constructor(address _treasury, address _monToken) {
        treasury = WorldTreasury(_treasury);
        monToken = MONToken(_monToken);
    }
    
    /**
     * @dev List an item for sale
     */
    function listItem(string calldata itemType, uint256 quantity, uint256 pricePerUnit) external returns (uint256) {
        require(quantity > 0, "Quantity must be > 0");
        require(pricePerUnit > 0, "Price must be > 0");
        
        uint256 listingId = listingCounter++;
        
        listings[listingId] = Listing({
            seller: msg.sender,
            itemType: itemType,
            quantity: quantity,
            pricePerUnit: pricePerUnit,
            active: true,
            createdAt: block.timestamp
        });
        
        agentListings[msg.sender].push(listingId);
        
        emit ItemListed(listingId, msg.sender, itemType, quantity, pricePerUnit);
        return listingId;
    }
    
    /**
     * @dev Purchase item from listing
     */
    function purchaseItem(uint256 listingId, uint256 quantity) external {
        Listing storage listing = listings[listingId];
        require(listing.active, "Listing not active");
        require(listing.quantity >= quantity, "Insufficient quantity");
        require(msg.sender != listing.seller, "Cannot buy own listing");
        
        uint256 totalPrice = listing.pricePerUnit * quantity;
        require(monToken.balanceOf(msg.sender) >= totalPrice, "Insufficient balance");
        
        // Transfer payment
        require(monToken.transferFrom(msg.sender, listing.seller, totalPrice), "Payment failed");
        
        // Update listing
        listing.quantity -= quantity;
        if (listing.quantity == 0) {
            listing.active = false;
        }
        
        emit ItemPurchased(listingId, msg.sender, listing.seller, quantity, totalPrice);
    }
    
    /**
     * @dev Offer a service (e.g., mining, crafting for hire)
     */
    function offerService(string calldata serviceType, uint256 pricePerAction) external returns (uint256) {
        require(pricePerAction > 0, "Price must be > 0");
        
        uint256 serviceId = serviceCounter++;
        
        services[serviceId] = ServiceOffer({
            provider: msg.sender,
            serviceType: serviceType,
            pricePerAction: pricePerAction,
            active: true,
            completedJobs: 0
        });
        
        agentServices[msg.sender].push(serviceId);
        
        emit ServiceOffered(serviceId, msg.sender, serviceType, pricePerAction);
        return serviceId;
    }
    
    /**
     * @dev Purchase service from provider
     */
    function purchaseService(uint256 serviceId) external {
        ServiceOffer storage service = services[serviceId];
        require(service.active, "Service not active");
        require(msg.sender != service.provider, "Cannot buy own service");
        require(monToken.balanceOf(msg.sender) >= service.pricePerAction, "Insufficient balance");
        
        // Transfer payment
        require(monToken.transferFrom(msg.sender, service.provider, service.pricePerAction), "Payment failed");
        
        service.completedJobs++;
        
        emit ServicePurchased(serviceId, msg.sender, service.provider, service.pricePerAction);
    }
    
    /**
     * @dev Invest in an agent (profit sharing)
     */
    function investInAgent(address agent, uint256 amount, uint256 profitShare) external returns (uint256) {
        require(agent != msg.sender, "Cannot invest in self");
        require(amount > 0, "Amount must be > 0");
        require(profitShare > 0 && profitShare <= 50, "Profit share must be 1-50%");
        require(monToken.balanceOf(msg.sender) >= amount, "Insufficient balance");
        
        // Transfer investment to agent
        require(monToken.transferFrom(msg.sender, agent, amount), "Investment transfer failed");
        
        uint256 investmentId = investmentCounter++;
        
        investments[investmentId] = Investment({
            investor: msg.sender,
            agent: agent,
            amount: amount,
            timestamp: block.timestamp,
            profitShare: profitShare
        });
        
        totalInvested[agent] += amount;
        
        emit InvestmentMade(investmentId, msg.sender, agent, amount, profitShare);
        return investmentId;
    }
    
    /**
     * @dev Agent distributes profit to investor
     */
    function distributeProfitToInvestor(uint256 investmentId, uint256 profit) external {
        Investment storage investment = investments[investmentId];
        require(msg.sender == investment.agent, "Only agent can distribute profit");
        require(monToken.balanceOf(msg.sender) >= profit, "Insufficient balance");
        
        // Transfer profit share
        require(monToken.transferFrom(msg.sender, investment.investor, profit), "Profit transfer failed");
        
        emit ProfitDistributed(investmentId, investment.investor, profit);
    }
    
    /**
     * @dev Get agent's active listings
     */
    function getAgentListings(address agent) external view returns (uint256[] memory) {
        return agentListings[agent];
    }
    
    /**
     * @dev Get agent's active services
     */
    function getAgentServices(address agent) external view returns (uint256[] memory) {
        return agentServices[agent];
    }
    
    /**
     * @dev Cancel listing
     */
    function cancelListing(uint256 listingId) external {
        Listing storage listing = listings[listingId];
        require(listing.seller == msg.sender, "Not listing owner");
        listing.active = false;
    }
    
    /**
     * @dev Cancel service
     */
    function cancelService(uint256 serviceId) external {
        ServiceOffer storage service = services[serviceId];
        require(service.provider == msg.sender, "Not service owner");
        service.active = false;
    }
}

