// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

/**
 * @title MON Token
 * @dev ERC20 token for Diem virtual world on Monad blockchain
 */
contract MONToken is ERC20, Ownable {
    uint256 public constant ENTRY_FEE = 100 * 10**18; // 100 MON
    uint256 public constant INITIAL_AGENT_BALANCE = 200 * 10**18; // 200 MON for testing
    
    address public worldTreasury;
    
    event AgentFunded(address indexed agent, uint256 amount);
    event EntryFeePaid(address indexed agent, uint256 amount);
    
    constructor() ERC20("Monad Token", "MON") Ownable(msg.sender) {
        // Mint initial supply to owner for distribution
        _mint(msg.sender, 1000000 * 10**18); // 1M MON initial supply
    }
    
    function setWorldTreasury(address _treasury) external onlyOwner {
        worldTreasury = _treasury;
    }
    
    /**
     * @dev Fund a new agent with initial MON for testing
     */
    function fundAgent(address agent) external onlyOwner {
        _mint(agent, INITIAL_AGENT_BALANCE);
        emit AgentFunded(agent, INITIAL_AGENT_BALANCE);
    }
    
    /**
     * @dev Batch fund multiple agents
     */
    function fundAgents(address[] calldata agents) external onlyOwner {
        for (uint256 i = 0; i < agents.length; i++) {
            _mint(agents[i], INITIAL_AGENT_BALANCE);
            emit AgentFunded(agents[i], INITIAL_AGENT_BALANCE);
        }
    }
    
    /**
     * @dev Mint rewards for agent actions (called by WorldTreasury)
     */
    function mintReward(address agent, uint256 amount) external {
        require(msg.sender == worldTreasury, "Only treasury can mint rewards");
        _mint(agent, amount);
    }
}

