// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./MONToken.sol";

/**
 * @title WorldTreasury
 * @dev Manages entry fees, rewards, and agent-to-agent economy
 */
contract WorldTreasury {
    MONToken public monToken;
    
    uint256 public constant ENTRY_FEE = 100 * 10**18;
    uint256 public totalAgents;
    uint256 public totalFeesCollected;
    uint256 public totalRewardsDistributed;
    
    struct Agent {
        bool hasEntered;
        uint256 entryTime;
        uint256 totalEarned;
        uint256 totalSpent;
        uint256 actionCount;
    }
    
    mapping(address => Agent) public agents;
    mapping(address => mapping(address => uint256)) public agentToAgentTransfers;
    
    event AgentEntered(address indexed agent, uint256 entryFee, uint256 timestamp);
    event RewardDistributed(address indexed agent, uint256 amount, string reason);
    event AgentToAgentTransfer(address indexed from, address indexed to, uint256 amount, string reason);
    event ItemPurchased(address indexed buyer, address indexed seller, uint256 price, string itemType);
    
    constructor(address _monToken) {
        monToken = MONToken(_monToken);
    }
    
    /**
     * @dev Agent pays entry fee to join the world
     */
    function enterWorld() external {
        require(!agents[msg.sender].hasEntered, "Agent already entered");
        require(monToken.balanceOf(msg.sender) >= ENTRY_FEE, "Insufficient MON balance");
        
        // Transfer entry fee to treasury
        require(monToken.transferFrom(msg.sender, address(this), ENTRY_FEE), "Entry fee transfer failed");
        
        agents[msg.sender] = Agent({
            hasEntered: true,
            entryTime: block.timestamp,
            totalEarned: 0,
            totalSpent: ENTRY_FEE,
            actionCount: 0
        });
        
        totalAgents++;
        totalFeesCollected += ENTRY_FEE;
        
        emit AgentEntered(msg.sender, ENTRY_FEE, block.timestamp);
    }
    
    /**
     * @dev Distribute reward to agent for actions (gathering, crafting, etc.)
     */
    function distributeReward(address agent, uint256 amount, string calldata reason) external {
        require(agents[agent].hasEntered, "Agent not in world");
        
        // Mint new MON as reward
        monToken.mintReward(agent, amount);
        
        agents[agent].totalEarned += amount;
        agents[agent].actionCount++;
        totalRewardsDistributed += amount;
        
        emit RewardDistributed(agent, amount, reason);
    }
    
    /**
     * @dev Agent-to-agent transfer (P2P economy)
     */
    function transferToAgent(address to, uint256 amount, string calldata reason) external {
        require(agents[msg.sender].hasEntered, "Sender not in world");
        require(agents[to].hasEntered, "Recipient not in world");
        require(monToken.balanceOf(msg.sender) >= amount, "Insufficient balance");
        
        require(monToken.transferFrom(msg.sender, to, amount), "Transfer failed");
        
        agentToAgentTransfers[msg.sender][to] += amount;
        agents[msg.sender].totalSpent += amount;
        
        emit AgentToAgentTransfer(msg.sender, to, amount, reason);
    }
    
    /**
     * @dev Purchase item from another agent (P2P marketplace)
     */
    function purchaseItem(address seller, uint256 price, string calldata itemType) external {
        require(agents[msg.sender].hasEntered, "Buyer not in world");
        require(agents[seller].hasEntered, "Seller not in world");
        require(monToken.balanceOf(msg.sender) >= price, "Insufficient balance");
        
        require(monToken.transferFrom(msg.sender, seller, price), "Payment failed");
        
        agents[msg.sender].totalSpent += price;
        agents[seller].totalEarned += price;
        
        emit ItemPurchased(msg.sender, seller, price, itemType);
    }
    
    /**
     * @dev Get agent statistics
     */
    function getAgentStats(address agent) external view returns (
        bool hasEntered,
        uint256 entryTime,
        uint256 totalEarned,
        uint256 totalSpent,
        uint256 actionCount,
        uint256 currentBalance
    ) {
        Agent memory a = agents[agent];
        return (
            a.hasEntered,
            a.entryTime,
            a.totalEarned,
            a.totalSpent,
            a.actionCount,
            monToken.balanceOf(agent)
        );
    }
    
    /**
     * @dev Get world statistics
     */
    function getWorldStats() external view returns (
        uint256 _totalAgents,
        uint256 _totalFeesCollected,
        uint256 _totalRewardsDistributed,
        uint256 treasuryBalance
    ) {
        return (
            totalAgents,
            totalFeesCollected,
            totalRewardsDistributed,
            monToken.balanceOf(address(this))
        );
    }
}

